webpackJsonp([0xf927f8900006],{381:function(A,e){A.exports={data:{site:{siteMetadata:{title:"The Blog - Matt Haws",subtitle:"Thoughts on programming, technology, pop culture, and life.",copyright:"© All rights reserved.",menu:[{label:"Articles",path:"/"},{label:"About me",path:"/about/"},{label:"Contact me",path:"/contact/"}],author:{name:"Matt Haws",email:"matthaws@gmail.com",telegram:"#",twitter:"#",github:"matthaws",rss:"#",vk:"#"}}},markdownRemark:{id:"/Users/appacademy/Desktop/Personal Projects/blog/src/pages/pages/2015-05-01---about/index.md absPath of file >>> MarkdownRemark",html:'<p>Hi, I’m Matt. I’m a life-long lover of tech, literature, video games, the arts, and bad puns. Basically an ideal day for me would involve a few hours of a PC strategy game, making a cool web app for people to use, telling at least one joke that gets a groan from 3 or more people, and then attending an opera or play in the evening (preferably <em>Tosca</em> or anything Shakespeare). I like in-depth conversations with people who have thoughtful opinions and points of view, with a particular love for serious dialogue about non-serious topics. I consider myself an introvert who loves people and collaboration. Personality type: INFP, religious affiliation: existential detective.</p>\n<p>I live in beautiful Greenpoint, Brooklyn, with my partner of ten years, Ian,  and our obnoxious and yet somehow-still-loveable cat.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/the-blog/static/matt_ian-94bd7ea62d0b5af86c9d42d9ceef89d6-7cf77.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 480px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 100%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Matt and Ian"\n        title=""\n        src="/the-blog/static/matt_ian-94bd7ea62d0b5af86c9d42d9ceef89d6-7cf77.jpg"\n        srcset="/the-blog/static/matt_ian-94bd7ea62d0b5af86c9d42d9ceef89d6-29d14.jpg 240w,\n/the-blog/static/matt_ian-94bd7ea62d0b5af86c9d42d9ceef89d6-7cf77.jpg 480w"\n        sizes="(max-width: 480px) 100vw, 480px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    \n<em>It’s a blurry photo. But let’s just pretend its an artsy Instagram filter, okay?</em></p>\n<p>I am passionate about life-long learning. I believe we should be constantly re-imagining and shaping ourselves throughout our lives. I strive to be open to new ideas and opinions, and to constantly scrutinize and re-evaluate my own beliefs and worldview.</p>\n<p>Writing about stuff is my key way of processing it. Welcome to my blog.</p>',frontmatter:{title:"About me",date:null,description:null}}},pathContext:{slug:"/about"}}}});
